import './css/ReadingBooks.css';
import React from 'react';

function Button({ name, src, alt }) {
    return (
        <a href="#"><img src={src} className={name} alt={alt} /></a>
    );
}

export default function Learning() {
    return (
        <div className='Learning_menu'>
            <Button name='Learning_Button_Left' src='/Left.png' alt="Left navigation button" />
            <div className='Learning_Book_Left'></div>
            <div className='Learning_Book_Right'></div>
            <Button name='Learning_Button_Right' src='/Right.png' alt="Right navigation button" />
        </div>
    );
}
